import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";

function Footer() {
  return (
    <footer className="bg-dark text-center text-white">
      <Container></Container>
    </footer>
  );
}

export default Footer;
